import React, { useEffect } from "react";

function Login(){
    function loginClicked(){
        localStorage.setItem("login",true)
        navigate("/")
        useEffect(()=>{
            let login = localStorage.getItem("login");
            if(login){
                navigate("/")
            }
        })
    }
    return(
        <>
           <input type="text"/> <br/>
           <input type="text"/> <br/>
           <button onClick={loginClicked}>Login</button>
        </>
    )
}


export default Login;
